import React, { useContext, useEffect } from "react";
import { UsersContext } from "./apk";
import { Link } from "react-router-dom";

export default function Read() {
    const context = useContext(UsersContext);
    
    useEffect(() => {
        console.log("testing de context", context.usersd);
    }, [context]);

    return (
        <>
            {context.usersd.length > 0 ? (
                <table className="table table-striped table-hover table-border mt-4 text-center">
                    <thead>
                        <tr>
                            <th scope="col">id</th>
                            <th scope="col">fullname</th>
                            <th scope="col">country</th>
                            <th scope="col">actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {context.usersd.map((user, key) => (
                            <tr key={key}>
                                <td scope="row">{user.id}</td>
                                <td>{user.fullname}</td>
                                <td>{user.country}</td>
                                <td>
                                    <button type="submit" className="btn btn-primary">
                                        <Link to={`/users/${user.id}/Update`} className="nav-link active">
                                            Update
                                        </Link>
                                    </button>

                                    <button type="submit" >
                                        <Link to={`/users/${user.id}/Delete`} className="nav-link active">
                                            Update
                                        </Link>
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            ) : (
                <h3 className="mt-4">No users available</h3>
            )}
        </>
    );
}
